import React,{useState} from 'react';
import './App.css';

function App() {

  let boards = useState([{'제목':'글제목1','내용':'글내용1'},{'제목':'글제목2','내용':'글내용2'},{'제목':'글제목3','내용':'글내용3'}]);

  let title = '투썸에서 리액트 개발';

  return (
    <div className="App">
      <div className="black-nav">
        <div>개발 Blog</div>

      </div>
      <h4>{title}</h4>
      <div>{boards[0].제목}</div>
      <div>{boards[0].내용}</div>
      <div>{boards[1].제목}</div>
      <div>{boards[1].내용}</div>
      <div>{boards[2].제목}</div>
      <div>{boards[2].내용}</div>
    </div>
  );
}

export default App;
